import React from 'react';

class Form extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            validation: {
                rules: {},
                messages: {},
                valid: false,
            },
            formValue: {}
        }
    }
    componentDidMount() {
        
        // console.log(this.props.config);
    }
    render() {

        return (
            <form name={this.props.config.name}>
                {Object.keys(this.props.config.elements).map((i)=>{
                    return <div className="form-group">
                        <label>{i}</label>
                        
                    </div>
                })}
            </form>
        );
    }
}

export default Form;
